import React from "react";

const Section = ({ id, children, sectionName}) => {
    return (
        <div id={id} className="section">
            <div>
                <h1>{sectionName}</h1>
            </div>
            <div>
                {children}
            </div>
        </div>
    );
};

export default Section;
